import React from "react";
import "./Work.css";

const projects = [
  {
    id: 1,
    title: "Invoice Generator",
    description: "Description of project one",
    image:
      "https://images.unsplash.com/photo-1503023345310-bd7c1de61c7d?w=800",
    tags: ["React", "CSS", "2025"],
    link: "#",
  },
  {
    id: 2,
    title: "WWeather App",
    description: "Description of project two",
    image:
      "https://images.unsplash.com/photo-1498050108023-c5249f4df085?w=800",
    tags: ["NextJS", "TypeScript", "2024"],
    link: "#",
  },
  {
    id: 3,
    title: "Portfolio Website",
    description: "Description of project three",
    image:
      "https://images.unsplash.com/photo-1498050108023-c5249f4df085?w=800",
    tags: ["NodeJS", "Express", "2023"],
    link: "#",
  },
  {
    id: 4,
    title: "Food Delivery App",
    description: "Description of project four",
    image:
      "https://images.unsplash.com/photo-1504384308090-c894fdcc538d?w=800",
    tags: ["React Native", "Mobile", "2025"],
    link: "#",
  },
  {
    id: 5,
    title: "Project Five",
    description: "Description of project five",
    image:
      "https://images.unsplash.com/photo-1498050108023-c5249f4df085?w=800",
    tags: ["GraphQL", "Apollo", "2024"],
    link: "#",
  },
  {
    id: 6,
    title: "Project Six",
    description: "Description of project six",
    image:
      "https://images.unsplash.com/photo-1504384308090-c894fdcc538d?w=800",
    tags: ["Docker", "Kubernetes", "2023"],
    link: "#",
  },
 
];

function Work() {
  return (
    <div className="work-container">
      <h2>My Projects</h2>
      <div className="project-grid">
        {projects.map((project) => (
          <a
            key={project.id}
            href={project.link}
            target="_blank"
            rel="noopener noreferrer"
            className="project-card"
            tabIndex={0}
          >
            <div className="project-image-wrapper">
              <img
                src={project.image}
                alt={project.title}
                className="project-image"
                loading="lazy"
              />
            </div>
            <div className="project-content">
              <h3 className="project-title">{project.title}</h3>
              <p className="project-description">{project.description}</p>
              <div className="project-tags">
                {project.tags.map((tag, i) => (
                  <span key={i} className="project-tag">
                    {tag}
                  </span>
                ))}
              </div>
            </div>
          </a>
        ))}
      </div>
    </div>
  );
}

export default Work;
